INSERT INTO `egstr_es_pluginconfig` VALUES("1", "Egystar", "info@egystarcopiers.com", "WP HTML MAIL", "YES", "info@egystarcopiers.com", "ايجي ستار New email subscription", "Hi Admin, \r\n\r\nWe have received a request to subscribe new email address to receive emails from our website. \r\n\r\nEmail: ###EMAIL### \r\nName : ###NAME### \r\n\r\nThank You\r\nايجي ستار", "YES", "ايجي ستار Welcome to our newsletter", "Hi ###NAME###, \r\n\r\nWe have received a request to subscribe this email address to receive newsletter from our website. \r\n\r\nThank You\r\nايجي ستار", "Double Opt In", "ايجي ستار confirm subscription", "مرحباً ###NAME###, \r\n\r\nA newsletter subscription request for this email address was received. Please confirm it by <a href=\\\'###LINK###\\\'>clicking here</a>. If you cannot click the link, please use the following link. \r\n\r\n ###LINK### \r\n\r\nThank You\r\nايجي ستار", "http://madyeg.com/?es=optin&db=###DBID###&email=###EMAIL###&guid=###GUID###", "http://madyeg.com/?es=unsubscribe&db=###DBID###&email=###EMAIL###&guid=###GUID###", "No longer interested email from ايجي ستار?. Please <a href=\\\'###LINK###\\\'>click here</a> to unsubscribe", "Thank You, You have been successfully unsubscribed. You will no longer hear from us.", "Thank You, You have been successfully subscribed to our newsletter.", "Oops.. This subscription cant be completed, sorry. The email address is blocked or already subscribed. Thank you.", "Oops.. We are getting some technical error. Please try again or contact admin.");
INSERT INTO `egstr_es_templatetable` VALUES("1", "New post published ###POSTTITLE###", "Hello ###NAME###,\r\n\r\nWe have published new blog in our website. ###POSTTITLE###\r\n###POSTDESC###\r\nYou may view the latest post at ###POSTLINK###\r\nYou received this e-mail because you asked to be notified when new updates are posted.\r\n\r\nThanks & Regards\r\nAdmin", "Published", "Dynamic Template");
INSERT INTO `egstr_es_templatetable` VALUES("2", "Post notification ###POSTTITLE###", "Hello ###EMAIL###,\r\n\r\nWe have published new blog in our website. ###POSTTITLE###\r\n###POSTIMAGE###\r\n###POSTFULL###\r\nYou may view the latest post at ###POSTLINK###\r\nYou received this e-mail because you asked to be notified when new updates are posted.\r\n\r\nThanks & Regards\r\nAdmin", "Published", "Dynamic Template");
INSERT INTO `egstr_es_templatetable` VALUES("3", "Hello World Newsletter", "<strong style=\"color: #990000\"> Email subscribersr</strong><p>Email subscribers plugin has options to send newsletters to subscribers. It has a separate page with HTML editor to create a HTML newsletter. Also have options to send notification email to subscribers when new posts are published to your blog. Separate page available to include and exclude categories to send notifications. Using plugin Import and Export options admins can easily import registered users and commenters to subscriptions list.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification email to subscribers when new posts are published.</li> <li>Subscription box.</li><li>Double opt-in and single opt-in facility for subscriber.</li> <li>Email notification to admin when user signs up (Optional).</li> <li>Automatic welcome mail to subscriber (Optional).</li> <li>Unsubscribe link in the mail.</li> <li>Import/Export subscriber emails.</li> <li>HTML editor to compose newsletter.</li> </ol> <p>Plugin live demo and video tutorial available on the official website. Check official website for more information.</p> <strong>Thanks & Regards</strong><br>Admin", "Published", "Static Template");
