width=\"301\">Standard: 1 x 250 sheets (drawer), 100 sheets (bypass) Maximum: 1,700 sheets250 sheets</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">----</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">----</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">48 MB/112 MB</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">----</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">600 x 659 x 463 mmApprox. 33 kg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25-200% (1% increments), various pre-set ratios</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">600 x 600 dpi (Not available when network printer kit is installed)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">600, 300 dpi</td>\r\n</tr>\r\n</tbody>\r\n</table>\";s:10:\"post_title\";s:29:\"توشيبا ستوديو 205\";s:12:\"post_excerpt\";s:1384:\"الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 50000 نسخة شهريا\r\nالسرعة : 20 صورة فى الدقيقة\r\nحجم الورق المستخدم: A3- B5 (الادراج 1،2) - A3-A5R\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 80 جرام\r\nالمسار الجانبى : من وزن 50 جرام حتى وزن 163 جرام\r\nادراج الورق : عدد 1 درج اساسى 250 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 25 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 200 %\r\nدقة الطباعة : 600 * 600\r\nدقة المسح 300 * 600\r\nالذاكرة: 48ميجابيت اساسى\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 35000 نسخة\";s:11:\"post_status\";s:7:\"publish\";s:14:\"comment_status\";s:4:\"open\";s:11:\"ping_status\";s:6:\"closed\";s:13:\"post_password\";s:0:\"\";s:9:\"post_name\";s:77:\"%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-205\";s:7:\"to_ping\";s:0:\"\";s:6:\"pinged\";s:0:\"\";s:13:\"post_modified\";s:19:\"2015-08-25 13:59:31\";s:17:\"post_modified_gmt\";s:19:\"2015-08-25 10:59:31\";s:21:\"post_content_filtered\";s:0:\"\";s:11:\"post_parent\";i:0;s:4:\"guid\";s:67:\"http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=70\";s:10:\"menu_order\";i:0;s:9:\"post_type\";s:7:\"product\";s:14:\"post_mime_type\";s:0:\"\";s:13:\"comment_count\";s:1:\"0\";s:6:\"filter\";s:3:\"raw\";}s:12:\"product_type\";s:6:\"simple\";s:17:\"\0*\0shipping_class\";s:0:\"\";s:20:\"\0*\0shipping_class_id\";i:0;s:5:\"price\";s:4:\"3750\";}}}\";s:19:\"cart_contents_total\";i:0;s:20:\"cart_contents_weight\";i:0;s:19:\"cart_contents_count\";i:0;s:5:\"total\";i:0;s:8:\"subtotal\";i:0;s:15:\"subtotal_ex_tax\";i:0;s:9:\"tax_total\";i:0;s:5:\"taxes\";s:6:\"a:0:{}\";s:14:\"shipping_taxes\";s:6:\"a:0:{}\";s:13:\"discount_cart\";i:0;s:17:\"discount_cart_tax\";i:0;s:14:\"shipping_total\";i:0;s:18:\"shipping_tax_total\";i:0;s:9:\"fee_total\";i:0;s:4:\"fees\";s:6:\"a:0:{}\";s:10:\"wc_notices\";N;s:21:\"chosen_payment_method\";s:3:\"cod\";s:8:\"customer\";s:661:\"a:14:{s:8:\"postcode\";s:4:\"1254\";s:4:\"city\";s:10:\"دكرنس\";s:9:\"address_1\";s:34:\"نجير   الطريق العام\";s:9:\"address_2\";s:73:\"المحل مقابل بنزينة التعاون الطريق العام\";s:5:\"state\";s:16:\"الدقهلية\";s:7:\"country\";s:2:\"EG\";s:17:\"shipping_postcode\";s:4:\"1254\";s:13:\"shipping_city\";s:10:\"دكرنس\";s:18:\"shipping_address_1\";s:34:\"نجير   الطريق العام\";s:18:\"shipping_address_2\";s:73:\"المحل مقابل بنزينة التعاون الطريق العام\";s:14:\"shipping_state\";s:16:\"الدقهلية\";s:16:\"shipping_country\";s:2:\"EG\"