INSERT INTO `egstr_postmeta` VALUES("4750", "105", "_yoast_wpseo_metadesc", "ماضي جروب مجموعة مصرية مؤسسة عام 1994 و متعددة الاستثمارات التجارية. ماضي جروب مكونة من: مصنع و خط انتاج للمنتجات البلاستيكية بما تشمله من عمليات انتاجية متكاملة و متقدمة، تشمل ايضا ماضي للتجارة و الصناعة و تدعم استيراد و توريد معدات و ماكينات المنتجات البلاستيكية، و ايضا ماضي للاستيراد و التصدير لتجارة المنتجات و الأدوات المنزلية مثل الأدوات و السجاد و المفروشات.");
