INSERT INTO `egstr_posts` VALUES("5", "1", "2015-07-22 09:41:27", "2015-07-22 06:41:27", "<div class=\"cf-style-1\">\r\n<div class=\"row field-row\">\r\n<div class=\"col-xs-12 col-sm-6\">\r\n<label>الإسم*</label>[text* your-name class:le-input]\r\n</div>\r\n<div class=\"col-xs-12 col-sm-6\">\r\n<label>البريد*</label>[email* your-email class:le-input]\r\n</div>\r\n</div>\r\n<!-- /.field-row -->\r\n<div class=\"field-row\">\r\n<label>الموبايل*</label>[tel* your-mobile class:le-input]\r\n</div>\r\n<!-- /.field-row -->\r\n<div class=\"field-row\">\r\n<label>التعليقات</label>[textarea your-message x8 class:le-input]\r\n</div>\r\n<!-- /.field-row -->\r\n<div class=\"buttons-holder\">\r\n[submit class:le-button class:huge \"ارسال الرسالة\"]\r\n</div>\r\n<!-- /.buttons-holder -->\r\n</div>\nتسجيل طلب اتصال علي الموقع\ninfo@madyeg.com\nتسجيل طلب اتصال جديد علي موقع ماضي جروب بالبيانات التالية:\r\nالاسم:[your-name]\r\nالإيميل:[your-email]\r\nالموبايل:[your-mobile]\r\nنص الطلب:\r\n[your-message]\r\n--\r\nرسالة تنبية لتسجيل الطلب من موقع ماضي جروب\nmadygroupegypt@yahoo.com\nReply-To: [your-email]\n\n\n\n\nتسجيل طلب اتصال علي الموقع\nُموقع إيجي ستار\nتسجيل طلب اتصال جديد علي موقع ايجي ستار بالبيانات التالية:\r\nالاسم:[your-name]\r\nالإيميل:[your-email]\r\nالموبايل:[your-mobile]\r\nنص الطلب:\r\n[your-message]\r\n--\r\nرسالة تنبية لتسجيل الطلب من موقع ايجي ستار\ninfo@ownsource.org\nReply-To: [your-email]\n\n\n\nتم إرسال الرسالة بنجاح. سيتم الإتصال بك من قبل احد ممثلينا\nفشل في إرسال الرسالة. الرجاء المحاولة مجدداً أو مخاطبة المسؤول عن الموقع بطريقة أخرى مثل الفيس بوك أو التويتر.\nحدث خطأ أثناء التحقق. الرجاء التأكد من الحقول ومعاودة الإرسال مجدداً.\nفشل في إرسال الرسالة. الرجاء المحاولة مجدداً أو مخاطبة المسؤول عن الموقع بطريقة أخرى مثل الفيس بوك أو التويتر.\nالرجاء الموافقة على الشروط لإكمال العمليّة.\nPlease fill in the required field.\nThis input is too long.\nThis input is too short.\nلقد قمت بإدخال كود خاطئ.\nالرقم أصغر من الحد الأدنى\nالرقم صغير جداً\nالرقم كبير جداً.\nيبدو أن البريد الإلكتروني خاطئ\nيبدو أن الرابط غير صحيح\nيبدو أن رقم الهاتف غير صحيح\nإجابتك غير صحيحة.\nصيغة التاريخ تبدو غير صحيحة.\nالتاريخ مبكر جداً.\nالتاريخ بعيد جداً.\nفشل في رفع الملف\nهذا النوع من الملفات غير مسموح به\nهذا الملف كبير جداً\nخطأ في رفع الملف.", "فورم طلب اتصال", "", "publish", "open", "open", "", "%d8%a7%d8%b3%d8%aa%d9%85%d8%a7%d8%b1%d8%a9-%d8%a7%d9%84%d9%85%d8%b1%d8%a7%d8%b3%d9%84%d8%a9-1", "", "", "2016-07-28 19:39:11", "2016-07-28 16:39:11", "", "0", "http://madyeg.com/?post_type=wpcf7_contact_form&#038;p=5", "0", "wpcf7_contact_form", "", "0");
INSERT INTO `egstr_posts` VALUES("934", "1", "2015-08-02 16:48:15", "2015-08-02 13:48:15", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/e-STUDIO855SEBrochure.pdf\" target=\"_blank\">View PDF</a>\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">85  cpm</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Appx. 130 Seconds</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">Cassette: Statement-R to Ledger (17-110 lbs.)Bypass: Statement-R to 11” x 17” (17-110 lbs.)LCF: Letter Only (17-110 lbs.)Std. Bond, Post CardTab Sheets - Bypass + 1/2 Drawers</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">Standard Paper Supply 2 x 500-Sheet Drawer; 1 x 2,500-Sheet Tandem Drawer;100-Sheet Stack Feed BypassMaximum Paper Supply Up to 7,600 Sheets (w/Optional 4,000-Sheet LCF)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">-</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">8.5” Wide VGA Color Touch-Screen</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">1GB RAM, 60 GB HDD</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">Ethernet 10/100BaseTUSB 2.0, 802.11b/g Wirelesss LANBluetooth (HCRP)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">Appx. 28” x 31” x 46” (W x D x H)Appx. 462 lbs.</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25% to 400%</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">2400 x 600 dpi</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">\r\n<p dir=\"ltr\">150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>", "Toshiba E-studio 855", "ماكينة تصوير Toshiba e-Studio 855\r\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\r\nالسرعة : 85 صورة فى الدقيقة\r\nحجم الورق المستخدم: A4 – A3 – A5R<span class=\"text_exposed_show\">\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\r\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\r\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 130 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 2400\r\nدقة المسح 600 * 600\r\nالذاكرة: 1 جيجابيت اساسى\r\nالتوصيلات : USB 2.0 / Network Sharing\r\n</span>", "inherit", "open", "open", "", "909-autosave-v1", "", "", "2015-08-02 16:48:15", "2015-08-02 13:48:15", "", "909", "http://madyeg.com/909-autosave-v1/", "0", "revision", "", "0");
