\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25% to 400% (1% Increment) (Glass)25% to 200% (1% Increment) (Original on RADF)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">600 x 600 dpi, 8 bit (Full colour)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">600 x 600 dpi, (10 bit/1024 levels)</td>\r\n</tr>\r\n</tbody>\r\n</table>", "توشيبا ستوديو 3520", "ماكينة تصوير  Toshiba e-Studio 3520 color\r\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\r\nالسرعة : 35 صورة فى الدقيقة\r\nحجم الورق المستخدم:   A4 – A3 – A5R - A6R\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 256 جرام\r\nالمسار الجانبى : من وزن 64 جرام حتى وزن 280 جرام\r\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 89 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 600\r\nدقة المسح 600 * 600\r\nالذاكرة: 1 جيجابيت اساسى\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 10000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-3520__trashed", "", "", "2016-07-21 03:12:19", "2016-07-21 00:12:19", "", "0", "http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=34", "0", "product", "", "0");
INSERT INTO `egstr_posts` VALUES("37", "1", "2013-06-07 10:53:15", "2013-06-07 07:53:15", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-5520c-6520c.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Model </strong></td>\r\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 6520</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">65 ppm</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Approx. &lt;70 seconds from low-power mode</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">Cassettes: A5R-320 x 460 mm, 64-256 gsmTandem LCF2): A4, 64-256 gsmBypass: A6R-13” x 19”, 64-300 gsm,banner paper 313 x 1,200 mm, 64-256 gsm</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">(Cassettes) + 2,320 sheets (Tandem LCF)2),100 sheets (Bypass)Maximum: 6,0002) sheets with external LCF1)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">Up to 320 x 460 mm and 256 gsm</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">Toshiba e-BRIDGE</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">80 GB HDD, 2.0 GB RAM</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">10/100/1000BaseT (incl. IPv6), High-SpeedUSB 2.0, WLAN1) (IEEE802.11b/g), Bluetooth1)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">980 x 698 x 1,540 mm (W x D x H), ~ 246 kg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">Max. 600 x 600 dpi, 8 bit per channelMax. 1,200 x 1,200 dpi, 2 bit per channel3)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">Max. 600 x 600 dpi, 8 bit per channel</td>\r\n</tr>\r\n</tbody>\r\n</table>", "توشيبا ستوديو 6520", "الامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 200000 نسخة شهريا\r\nالسرعة : 65 صورة فى الدقيقة\r\nحجم الورق المستخدم: A4 – A5R - A6R\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 256 جرام\r\nالمسار الجانبى : من وزن 64 جرام حتى وزن 280 جرام\r\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 70 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 600\r\nدقة المسح 600 * 600\r\nالذاكرة:2 جيجابيت اساسى\r\n80 جيجابيت HDD\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 15000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-6520__trashed", "", "", "2016-07-21 03:12:19", "2016-07-21 00:12:19", "", "0", "http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=37", "0", "product", "", "0");
