INSERT INTO `egstr_posts` VALUES("76", "1", "2013-06-07 11:28:45", "2013-06-07 08:28:45", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-450-346.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Model </strong></td>\r\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 450</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">45 PPM (Letter)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Approximately 20 Seconds</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">Statement-R (5.5\" x 8.5\") to Ledger(11\" x 17\"), 17-28 lbs.; Stack Feed “Smart”Bypass 17-53 lbs. (110 lbs. Index)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">2 Standard Cassettes @ 550 Sheets(17-28 lbs.); 100-Sheet Bypass</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">Duplex Originals (13-28 lbs.)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">Automatic Toner Density Monitoringand Dispensing from Toner Cartridge</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">128 MB, 40+ GB HDD</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">Graphic Display; Icon Based LCDTouch Panel; Key Top</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">26” x 28” x 29” (W x D x H)Approximately 177 lbs.</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25% to 400%</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">2400 x 600 dpi</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi,600 dpi</td>\r\n</tr>\r\n</tbody>\r\n</table>", "توشيبا ستوديو 450", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\r\nالسرعة : 45 صورة فى الدقيقة\r\nحجم الورق المستخدم: A4 – A3 – A5R\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\r\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\r\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 20 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 2400\r\nدقة المسح 600 * 600\r\nالذاكرة: 128 ميجابيت اساسى\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 40000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-450__trashed", "", "", "2016-07-21 03:12:19", "2016-07-21 00:12:19", "", "0", "http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=76", "0", "product", "", "0");
INSERT INTO `egstr_posts` VALUES("79", "1", "2013-06-07 11:29:44", "2013-06-07 08:29:44", "توشيبا ستوديو 350 Toshiba E-studio\r\n\r\n<img class=\"alignnone wp-image-1013 size-full\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"عرض ملف التعريف لماكينة توشيبا ستوديو\" width=\"208\" height=\"60\" />\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Model </strong></td>\r\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 350</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">35  PPM (Letter)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Approximately 20 Seconds</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">Statement-R (5.5\" x 8.5\") to Ledger(11\" x 17\"), 17-28 lbs.; Stack Feed “Smart”Bypass 17-53 lbs. (110 lbs. Index)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">2 Standard Cassettes @ 550 Sheets(17-28 lbs.); 100-Sheet Bypass</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">Duplex Originals (13-28 lbs.)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">Automatic Toner Density Monitoringand Dispensing from Toner Cartridge</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">128 MB, 40+ GB HDD</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">Graphic Display; Icon Based LCDTouch Panel; Key Top</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">26” x 28” x 29” (W x D x H)Approximately 177 lbs.</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25% to 400%</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">2400 x 600 dpi</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi,600 dpi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;", "توشيبا ستوديو 350", "ماكينة تصوير توشيبا ستوديو 350 Toshiba E studio\r\n\r\nالامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 10000 نسخة شهريا\r\nالسرعة : 35 صورة فى الدقيقة\r\nحجم الورق المستخدم: A4 – A3 – A5R\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\r\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\r\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 20 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 2400\r\nدقة المسح 600 * 600\r\nالذاكرة: 128 ميجابيت اساسى\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 40000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-350__trashed", "", "", "2016-07-21 03:12:18", "2016-07-21 00:12:18", "", "0", "http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=79", "0", "product", "", "0");
INSERT INTO `egstr_posts` VALUES("83", "1", "2013-06-07 11:33:05", "2013-06-07 08:33:05", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio233-283-printer-brochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Model </strong></td>\r\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 283</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">28  ppm (A4), 16 ppm (A3)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Approx. 25 seconds</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">Cassettes: A5R-A3, 64-105 gsmLarge Capacity Feeder 1: A4, 64-105 gsmBypass: A5R-A3, 50-209 gsm</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">2 x 550 sheets (Cassettes), 100 sheets (Bypass)Maximum: 3,700 sheets</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">A5R-A3, 64-105 gsm</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">Toshiba e-BRIDGE</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">40 GB HDD / 288 MB RAM (max. 544 MB)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">10/100BaseT (incl. IPv6), Full-speed USB,WLAN 1 (IEEE802.11b/g), Bluetooth</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">637 x 719 x 739 mm (W x D x H), ~ 76.6 kg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">Max. 2,400 x 600 dpi (with smoothing), 8 bit</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">Max. 600 x 600 dpi, mono</td>\r\n</tr>\r\n</tbody>\r\n</table>", "توشيبا ستوديو 283", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\r\nالسرعة : 28 صورة فى الدقيقة(A4)\r\n16 صورة في الدقيقة(A3)\r\nحجم الورق المستخدم: A4 – A3 – A5R - B4 - B5\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\r\nالمسار الجانبى : من وزن 50 جرام حتى وزن 209 جرام\r\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 25 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 2400\r\nدقة المسح 600 * 600\r\nالذاكرة: 288 ميجابيت اساسى\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 40000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-283__trashed", "", "", "2016-07-21 03:12:18", "2016-07-21 00:12:18", "", "0", "http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=83", "0", "product", "", "0");
INSERT INTO `egstr_posts` VALUES("87", "1", "2013-06-07 11:34:14", "2013-06-07 08:34:14", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio232-282-printer-specifications-brochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Model </strong></td>\r\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 282</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">28 ppm (A4)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Approx. 25 seconds</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">A3–A5R64-105 gsm (Drawer, Duplex, LCF*)64-209 gsm (Bypass)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">Standard: 2 x 550 sheets (Drawer),100 sheets (Bypass)Maximum: 3,700 sheets</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\">Stackless (standard)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\">Desktop</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">Standard 40+ GB (shared)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">User Interface (including Dual-Function)Standard: 10BaseT/100BaseTX, Full-speedUSBOptional: IEEE802.11b/802.11g (WiFi),Bluetooth</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">637 x 715 x 739 mmApprox. 74.8 kg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25%-400% (Platen), 25%-200% (RADF*)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">2,400 x 600 dpi (with smoothing)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\r\n</tr>\r\n</tbody>\r\n</table>", "توشيبا ستوديو 282", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\r\nالسرعة : 28 صورة فى الدقيقة\r\nحجم الورق المستخدم: A4 – A3 – A5R - B4 - B5\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\r\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\r\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 25 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 2400\r\nدقة المسح 600 * 600\r\nالذاكرة: 40 جيجابيت اساسى\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 40000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-282__trashed", "", "", "2016-07-21 03:12:18", "2016-07-21 00:12:18", "", "0", "http://demo2.woothemes.com/woocommerce/?post_type=product&#038;p=87", "0", "product", "", "0");
