INSERT INTO `egstr_posts` VALUES("815", "1", "2016-07-26 18:01:54", "2016-07-26 15:01:54", "[vc_row full_width=\"\" parallax=\"\" parallax_image=\"\" has_container=\"\" container_class=\"container\" row_animation=\"none\"][/vc_row][vc_row full_width=\"\" parallax=\"\" parallax_image=\"\" has_container=\"\" container_class=\"container\" row_animation=\"none\" css=\".vc_custom_1411476739640{padding-top: 50px !important;padding-bottom: 50px !important;background-color: #e8e8e8 !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\"][/vc_row]", "عن ماضي جروب", "", "inherit", "open", "open", "", "215-autosave-v1", "", "", "2016-07-26 18:01:54", "2016-07-26 15:01:54", "", "215", "http://madyeg.com/215-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1096", "1", "2016-07-26 18:11:24", "2016-07-26 15:11:24", "<h1 style=\"text-align: center;\"><span style=\"color: #003366;\">ماضي جروب </span></h1>\r\n<p style=\"text-align: center;\">ماضي جروب مجموعة مصرية مؤسسة عام 1994 و متعددة الاستثمارات التجارية. ماضي جروب مكونة من: مصنع و خط انتاج للمنتجات البلاستيكية بما تشمله من عمليات انتاجية متكاملة و متقدمة، تشمل ايضا ماضي للتجارة و الصناعة و تدعم استيراد و توريد معدات و ماكينات المنتجات البلاستيكية، و ايضا ماضي للاستيراد و التصدير لتجارة المنتجات و الأدوات المنزلية مثل الأدوات و السجاد و المفروشات.</p>\r\n<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\">ماضي جروب تقدم خدمات بيعية و انتاجية متكاملة في  تخصصات انتاج و تجارة المواد و الأدوات البلاستيكية، نعمل علي تقديم خبراتنا في الأسواق العالمية و توفير المنتجات و المعدات المثالية و المتطورة التي تشمل جميع متطلبات السوق المحلي و الدولي.</p>\r\n<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\">ماضي جرب شركة عالمية لها فروع نشطة في دول جنوب افريقيا و تحديد في غانا و زامبيا و أوغندا و ذلك لتوفير جهات اتصال و توريد علي اهم النقاط التجارية البيعية في قارة افريقيا. يمكن الاتصال بنا عن طريق بيانات التواصل الموضحة في صفحة الاتصال بنا.</p>", "عن ماضي جروب", "", "publish", "closed", "closed", "", "%d8%b9%d9%86-%d9%85%d8%a7%d8%b6%d9%8a-%d8%ac%d8%b1%d9%88%d8%a8", "", "", "2016-07-26 18:35:57", "2016-07-26 15:35:57", "", "0", "http://madyeg.com/?page_id=1096", "0", "page", "", "0");
