INSERT INTO `egstr_posts` VALUES("845", "1", "2015-07-26 15:19:58", "2015-07-26 12:19:58", "[vc_row has_container=\"true\" container_class=\"container\" el_class=\"inner-top-xs inner-bottom-sm\"][vc_column width=\"8/12\"][vc_column_text]\r\n<h2>عن شركتنا</h2>\r\nإيجي ستار شركة متخصصة في توفير و دعم ماكينات التصوير المكتبية، و نتخصص في تقديم و عرض جميع موديلات ماكينات التصوير توشيبا E-Studio و يتوفر لدينا خدمات الإستبدال و الصيانة الدورية للماكينات القديمة لديك.\r\n\r\nايجي ستار تتميز بسرعة و سهولة التواصل، و تقديم خدمات صيانة ماكينات التصوير بشكل متخصص و سريع، و ذلك يضمن لك عدم القلق من مشاكل ماكينات التصوير الخاصة بمكتبك بعد الآن\r\n<h2>Our Goal and Idea</h2>\r\nDonec libero dolor, tincidunt id laoreet vitae, ullamcorper eu tortor. Maecenas pellentesque, dui vitae iaculis mattis, tortor nisi faucibus magna, vitae ultrices lacus purus vitae metus. Ut nec odio facilisis, ultricies nunc eget, fringilla orci. Nulla lobortis sem dapibus, aliquet turpis eu, ornare neque. Sed nec sem diam. Mauris neque purus, malesuada at velit vel, tempus congue nisl. Ut aliquam semper augue hendrerit varius. Fusce pretium tempus volutpat. Vivamus dignissim posuere aliquet. In hac habitasse platea dictumst.[/vc_column_text][/vc_column][vc_column width=\"4/12\"][/vc_column][/vc_row][vc_row has_container=\"true\" container_class=\"container\" el_class=\"light-bg inner-sm\"][vc_column width=\"3/12\"][vc_column_text]\r\n<h2>ما يميز ايجي ستار</h2>\r\nايجي ستار شركة متخصصة في خدمات و دعم ماكينات التصوير توشيبا، و نعني بالدعم تقديم كافة خدمات ماكينات التصوير بشكل احترافي و متخصص.\r\n\r\nايجي ستار تشكل مجتمع خدمي متكامل لحل كل مشاكل ماكينات التصوير التي يواجهها عملائنا ابتداءاً من مرحلة الشراء وصولاً لما بعد البيع من صيانة و فحوصات دورية.[/vc_column_text][/vc_column][vc_column width=\"9/12\"][vc_row_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"Fast Delivery\" description=\"Sed in mi rutrum, mattis eros ut, sagittis orci. Suspendisse vehicula auctor leo, nec egestas tellus fringilla ac integer.\" icon_class=\"fa-truck\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"Support 24/7\" description=\"Sed in mi rutrum, mattis eros ut, sagittis orci. Suspendisse vehicula auctor leo, nec egestas tellus fringilla ac integer.\" icon_class=\"fa-life-saver\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"Best Quality\" description=\"Sed in mi rutrum, mattis eros ut, sagittis orci. Suspendisse vehicula auctor leo, nec egestas tellus fringilla ac integer.\" icon_class=\"fa-star\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]", "عن ايجي ستار", "", "inherit", "open", "open", "", "215-revision-v1", "", "", "2015-07-26 15:19:58", "2015-07-26 12:19:58", "", "215", "http://madyeg.com/215-revision-v1/", "0", "revision", "", "0");
