nner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"دعم 24 ساعة/يوم\" description=\"نحن متواجدون دائماً للرد علي طلبك و لتوفير الدعم الفوري لأعطالك. نقدم خدمة الصيانة بأقصى سرعة ممكنة.\" icon_class=\"fa-life-saver\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"Best Quality\" description=\"Sed in mi rutrum, mattis eros ut, sagittis orci. Suspendisse vehicula auctor leo, nec egestas tellus fringilla ac integer.\" icon_class=\"fa-star\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]", "عن ايجي ستار", "", "inherit", "open", "open", "", "215-revision-v1", "", "", "2015-07-26 15:50:02", "2015-07-26 12:50:02", "", "215", "http://madyeg.com/215-revision-v1/", "0", "revision", "", "0");
