 تحديد المنتج المناسب لنشاطك التجاري.[/vc_column_text][/vc_column][/vc_row][vc_row has_container=\"true\" container_class=\"container\" el_class=\"light-bg inner-sm\"][vc_column width=\"3/12\"][vc_column_text]\r\n<h2>ما يميز ايجي ستار</h2>\r\nايجي ستار شركة متخصصة في خدمات و دعم ماكينات التصوير توشيبا، و نعني بالدعم تقديم كافة خدمات ماكينات التصوير بشكل احترافي و متخصص.\r\n\r\nايجي ستار تشكل مجتمع خدمي متكامل لحل كل مشاكل ماكينات التصوير التي يواجهها عملائنا ابتداءاً من مرحلة الشراء وصولاً لما بعد البيع من صيانة و فحوصات دورية.[/vc_column_text][/vc_column][vc_column width=\"9/12\"][vc_row_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"سرعة التوصيل\" description=\"اطلب منتجك اونلاين و سيصلك بأقصي سرعة ممكنة أينما كنت.\" icon_class=\"fa-truck\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"دعم 24 ساعة/يوم\" description=\"نحن متواجدون دائماً للرد علي طلبك و لتوفير الدعم الفوري لأعطالك. نقدم خدمة الصيانة بأقصى سرعة ممكنة.\" icon_class=\"fa-life-saver\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"Best Quality\" description=\"Sed in mi rutrum, mattis eros ut, sagittis orci. Suspendisse vehicula auctor leo, nec egestas tellus fringilla ac integer.\" icon_class=\"fa-star\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]", "عن ايجي ستار", "", "inherit", "open", "open", "", "215-revision-v1", "", "", "2015-07-26 16:06:27", "2015-07-26 13:06:27", "", "215", "http://madyeg.com/215-revision-v1/", "0", "revision", "", "0");
