\" description=\"نحن متواجدون دائماً للرد علي طلبك و لتوفير الدعم الفوري لأعطالك. نقدم خدمة الصيانة بأقصى سرعة ممكنة.\" icon_class=\"fa-life-saver\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"الدعم و الصيانة\" description=\"نقدم دعم متكامل و صيانة سريعة و دورية لماكينات التصوير، يمكنك التواصل معنا لتحديد العطل الموجود بمنتجك و سنحدد لك ميعاد وصول فريق الصيانة لتصليح العطل.\" icon_class=\"fa-star\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]", "عن ايجي ستار", "", "inherit", "open", "open", "", "215-revision-v1", "", "", "2015-07-26 16:18:00", "2015-07-26 13:18:00", "", "215", "http://madyeg.com/215-revision-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("870", "1", "2015-08-09 15:19:17", "2015-08-09 12:19:17", "[vc_row full_width=\"\" parallax=\"\" parallax_image=\"\" has_container=\"\" container_class=\"container\" row_animation=\"none\"][vc_column width=\"1/1\"][products columns=\"4\" orderby=\"title\" order=\"\"][mc_6_1_products_grid shortcode_name=\"recent_products\" orderby=\"date\" order=\"desc\"][/vc_column][/vc_row][vc_row full_width=\"\" parallax=\"\" parallax_image=\"\" has_container=\"\" container_class=\"container\" row_animation=\"none\"][vc_column width=\"1/1\"][vc_column_text css_animation=\"\"]\n\nI am text block. Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.\n\n[/vc_column_text][/vc_column][/vc_row]", "المنتجات", "", "inherit", "open", "open", "", "6-autosave-v1", "", "", "2015-08-09 15:19:17", "2015-08-09 12:19:17", "", "6", "http://madyeg.com/6-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("856", "1", "2015-08-01 20:58:22", "2015-08-01 17:58:22", "[vc_row el_class=\"inner-bottom-sm\" container_class=\"container\" row_animation=\"none\"][vc_column width=\"1/2\"][vc_column_text]\n<h2 class=\"bordered\"><span style=\"color: #008080;\">طلب صيانة ماكينة تصوير</span></h2>\n[/vc_column_text][vc_column_text]\n<p class=\"bordered\">طلب صيانة ماكينة تصوير من ايجي ستار هي خدمة إلكترونية عملية و سريعة، يمكنك تسجيل بيانات الاتصال بك و وصف العطل الذي تواجهه و سيتم التواصل معك من قبل فريق الدعم لتحديد ميعاد خلال 24 لدعم و صيانة ماكينة التصوير المعطلة.</p>\n[/vc_column_text][contact-form-7 id=\"867\" title=\"فورم طلب صيانة\"][vc_column_text]\n<h2 class=\"bordered\"><span style=\"color: #008080;\">فريق الدعم و الصيانة</span></h2>\nفريق الدعم و الصيانة مستعد بشكل دائم للرد علي أعطالك و تحديد مشكلتك و وضع ميعاد سريع لصيانة العطل، يصلك فريق الصيانة بمعدات مجهزة و متخصصة ليقوم بصيانة العطل في موقعك، نحن نصلك أينما كنت.[/vc_column_text][vc_column_text css_animation=\"\"]\n<p class=\"bordered\">طلب صيانة ماكينة تصوير من ايجي ستار هي خدمة إلكترونية عملية و سريعة، يمكنك تسجيل بيانات الاتصال بك و وصف العطل الذي تواجهه و سيتم التواصل معك من قبل فريق الدعم لتحديد ميعاد خلال 24 لدعم و صيانة ماكينة التصوير المعطلة.</p>\n[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_column_text]\n<h2 class=\"bordered\">موقعنا</h2>\n[/vc_column_text][mc_gmap style=\"default\" lat=\"29.9921863\" lon=\"31.1525914\" zoom=\"16\" map_min_height=\"250px\" add_get_directions=\"no\"][vc_column_text el_class=\"no-margin-bottom\"]\n<h3 class=\"highlight\">خدمة دعم فني 7/24</h3>\n[/vc_column_text][vc_row_inner][vc_column_inner width=\"1/2\"][vc_column_text]<img class=\"size-full wp-image-781\" src=\"http://madyeg.com/wp-content/uploads/2015/07/EgyStar-Logo.png\" alt=\"ايجي ستار لخدمات ماكينات التصوير\" width=\"233\" height=\"54\" />\n\n01211122289\n01003309204\n12, شارع الشيمى خلف مستشفي الهرم، الهرم، الجيزة.[/vc_column_text][/vc_column_inner][vc_column_inner width=\"1/2\"][vc_column_text]<i class=\"fa fa-skype\"></i><a href=\"mailto:info@egystarcopiers.com\" target=\"_blank\">info@egystarcopiers.com</a>[/vc_column_text][vc_btn title=\"Text on the button\" style=\"modern\" shape=\"rounded\" color=\"grey\" size=\"md\" align=\"inline\" i_align=\"left\" i_type=\"fontawesome\" i_icon_fontawesome=\"fa fa-adjust\" i_icon_openiconic=\"vc-oi vc-oi-dial\" i_icon_typicons=\"typcn typcn-adjust-brightness\" i_icon_entypo=\"entypo-icon entypo-icon-note\" i_icon_linecons=\"vc_li vc_li-heart\" css_animation=\"\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]", "طلب صيانة", "", "inherit", "open", "open", "", "225-autosave-v1", "", "", "2015-08-01 20:58:22", "2015-08-01 17:58:22", "", "225", "http://madyeg.com/225-autosave-v1/", "0", "revision", "", "0");
