INSERT INTO `egstr_posts` VALUES("866", "1", "2015-07-28 16:19:12", "2015-07-28 13:19:12", "[vc_row][vc_column width=\"1/1\"][mc_gmap style=\"default\" lat=\"29.9921863\" longitude=\"-0.152424\" zoom=\"16\" lon=\"31.1525914\" map_min_height=\"460px\" add_get_directions=\"yes\"][/vc_column][/vc_row][vc_row container_class=\"container\" has_container=\"true\"][vc_column width=\"8/12\"][vc_column_text]\r\n<h2 class=\"bordered\"><span style=\"color: #008080;\">اترك لنا رسالتك</span></h2>\r\nMaecenas dolor elit, semper a sem sed, pulvinar molestie lacus. Aliquam dignissim, elit non mattis ultrices, neque odio ultricies tellus, eu porttitor nisl ipsum eu massa.[/vc_column_text][contact-form-7 id=\"5\" title=\"فورم طلب الإتصال\"][/vc_column][vc_column width=\"4/12\"][vc_column_text]\r\n<h2 class=\"bordered\"><span style=\"color: #993300;\">متجرنا</span></h2>\r\n<address>12 شارع الشيمى -خلف مستشفى الهرم- شارع الهرم.\r\nالجيزة، مصر.</address>\r\n<h3><span style=\"color: #993300;\">ساعات العمل</span></h3>\r\n<ul class=\"list-unstyled operation-hours\">\r\n	<li class=\"clearfix\"><span class=\"day\">السبت: 9</span><span class=\"pull-right hours\">ص-9م</span></li>\r\n	<li class=\"clearfix\"><span class=\"day\">الأحد: 9</span><span class=\"pull-right hours\">ص-9م</span></li>\r\n	<li class=\"clearfix\"><span class=\"day\">الإثنين: 9</span><span class=\"pull-right hours\"><span class=\"pull-right hours\">ص-9م</span></span></li>\r\n	<li class=\"clearfix\"><span class=\"day\">الثلاثاء: 9</span><span class=\"pull-right hours\">ص-9م</span></li>\r\n	<li class=\"clearfix\"><span class=\"day\">الأربعاء: 9</span><span class=\"pull-right hours\">ص-9م</span></li>\r\n	<li class=\"clearfix\"><span class=\"day\">الخميس: 9</span><span class=\"pull-right hours\">ص-9م</span></li>\r\n	<li class=\"clearfix\"><span class=\"day\">الجمعة: عطلة رسمية.</span></li>\r\n</ul>\r\n<h3></h3>\r\n[/vc_column_text][/vc_column][/vc_row]", "الاتصال بنا", "", "inherit", "open", "open", "", "223-revision-v1", "", "", "2015-07-28 16:19:12", "2015-07-28 13:19:12", "", "223", "http://madyeg.com/223-revision-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1099", "1", "2016-07-26 18:35:57", "2016-07-26 15:35:57", "<h1 style=\"text-align: center;\"><span style=\"color: #003366;\">ماضي جروب </span></h1>\r\n<p style=\"text-align: center;\">ماضي جروب مجموعة مصرية مؤسسة عام 1994 و متعددة الاستثمارات التجارية. ماضي جروب مكونة من: مصنع و خط انتاج للمنتجات البلاستيكية بما تشمله من عمليات انتاجية متكاملة و متقدمة، تشمل ايضا ماضي للتجارة و الصناعة و تدعم استيراد و توريد معدات و ماكينات المنتجات البلاستيكية، و ايضا ماضي للاستيراد و التصدير لتجارة المنتجات و الأدوات المنزلية مثل الأدوات و السجاد و المفروشات.</p>\r\n<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\">ماضي جروب تقدم خدمات بيعية و انتاجية متكاملة في  تخصصات انتاج و تجارة المواد و الأدوات البلاستيكية، نعمل علي تقديم خبراتنا في الأسواق العالمية و توفير المنتجات و المعدات المثالية و المتطورة التي تشمل جميع متطلبات السوق المحلي و الدولي.</p>\r\n<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\">ماضي جرب شركة عالمية لها فروع نشطة في دول جنوب افريقيا و تحديد في غانا و زامبيا و أوغندا و ذلك لتوفير جهات اتصال و توريد علي اهم النقاط التجارية البيعية في قارة افريقيا. يمكن الاتصال بنا عن طريق بيانات التواصل الموضحة في صفحة الاتصال بنا.</p>", "عن ماضي جروب", "", "inherit", "closed", "closed", "", "1096-revision-v1", "", "", "2016-07-26 18:35:57", "2016-07-26 15:35:57", "", "1096", "http://madyeg.com/1096-revision-v1/", "0", "revision", "", "0");
