INSERT INTO `egstr_posts` VALUES("886", "1", "2015-08-02 14:09:35", "2015-08-02 11:09:35", "<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">16  ppm (A4)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 25 sec.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3-B5 (Drawer), A3-A5R (Bypass/ADF*)64-80 gsm (Drawer/Bypass Multi feed), 50-163 gsm (Bypass Single feed)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard 1 x 250 sheet Drawer + 100 sheet BypassMaximum 2 x 250 sheet Drawer + 100 sheet Bypass</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">----</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">----</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">16 MB / 80 MB</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">----</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">600 x 643 x 463 mm32 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-200% (1% increments), various pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600 dpi. 300 dpi</td>\n</tr>\n</tbody>\n</table>", "Toshiba E-studio 163", "ماكينة تصوير Toshiba e-Studio 163\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\nالسرعة : 16 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R<span class=\"text_exposed_show\">\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى\n+ مسار جانبى يسع 100 ورقة اساسى\nزمن تسخين الالة : 25 ثانية\nزمن اول نسخة : 7.3 ثانية\nالتكبير والتصغير : من 25 % الى 400 %\nدقة الطباعة : 600 * 2400\nدقة المسح 600 * 600\nالذاكرة: 16 ميجابيت اساسى\nالتوصيلات : USB 2.0 / Network Sharing</span>", "inherit", "open", "open", "", "67-autosave-v1", "", "", "2015-08-02 14:09:35", "2015-08-02 11:09:35", "", "67", "http://madyeg.com/67-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("892", "1", "2015-08-02 17:13:19", "2015-08-02 14:13:19", "View PDF\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">45  ppm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 20 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Drawers: A3/A4/A5-RStack Feed Bypass: A3/A4/A5-R\n\nLarge Capacity Feeder (Pedestal type): A4\n\nPaper Feed Pedestal: A3/A5-R\n\n&nbsp;\n\nDrawers: 64 - 105 g/m2\n\nStack Feed Bypass (Multi-feed):\n\n64 - 209 g/m2\n\nStack Feed Bypass (Single-feed):\n\n52 - 209 g/m2\n\nLarge Capacity Feeder (Pedestal type): 64 - 105 g/m2</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">With 80g/m2Standard 1200 sheets Drawer 1 (550 sheets), Drawer 2 (550 sheets),\n\nStack Feed Bypass (100 sheets)\n\nMax 3200 sheets Drawer 1 (550 sheets), Drawer 2 (550 sheets),\n\nLarge Capacity Feeder: (2000 sheets), Stack Feed Bypass (100 sheets)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Standard</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">1 beam laser printing (Memory copy standard)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">RAM: 1GB (Unified with Page and Main Memory)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Ethernet (10/100BASE-T), USB 2.0/Hi Speed USB ,Wireless LAN (option), Bluetooth (option)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">W575 x D586 x H756mm (22.6˝ x 23 ˝ x 29.8 ˝)Approx. 60kg (with drum and developer)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400% in 1% increment (Platen)25% to 200% in 1% increment (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">600 dpi x 600 dpi, 1 bit2,400 dpi x 600 dpi, with smoothing</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">100 dpi, 150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "Toshiba E-studio 455", "<pre class=\"product_title entry-title\">ماكينة تصوير Toshiba e-Studio 455\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\nالسرعة : 45 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R<span class=\"text_exposed_show\">\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى\n+ مسار جانبى يسع 100 ورقة اساسى\nزمن تسخين الالة : 20 ثانية\nزمن اول نسخة : 7.3 ثانية\nالتكبير والتصغير : من 25 % الى 400 %\nدقة الطباعة : 600 * 2400\nدقة المسح 600 * 600\nالذاكرة: 1 جيجابيت اساسى\nالتوصيلات : USB 2.0 / Network Sharing</span></pre>\n", "inherit", "open", "open", "", "47-autosave-v1", "", "", "2015-08-02 17:13:19", "2015-08-02 14:13:19", "", "47", "http://madyeg.com/47-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("895", "1", "2015-07-29 14:19:25", "2015-07-29 11:19:25", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-520-600-720-850.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\r\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\r\n<tbody>\r\n<tr>\r\n<td width=\"301\"><strong>Model </strong></td>\r\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 520</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\r\n<td width=\"301\">52 ppm (A4, 64-163gsm)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Warm-up Time</strong></td>\r\n<td width=\"301\">Approx. 130 seconds</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\r\n<td width=\"301\">A3 –A5R (Cassettes &amp; Bypass)A4 ( Tandem Large Capacity Feeder)A4 (Large Capacity Feeder - optional)A3+ (Post-Fusing Inserter Unit – optional)64-209 gsm (paper supply and ADU)\r\n\r\n50 –127 gsm (RADF)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Paper Capacity</strong></td>\r\n<td width=\"301\">2 x 500-sheet cassettes, 2,500-sheet A4 LCF,100-sheet By-Pass4,000-sheet A4 (LCF optional)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\r\n<td width=\"301\"></td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Controller Type</strong></td>\r\n<td width=\"301\"></td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Memory</strong></td>\r\n<td width=\"301\">Main Memory 256MB + Page Memory64MB – up to 320MB (shared)HDD 40GB+ (shared)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Interface</strong></td>\r\n<td width=\"301\">10baseT/100BaseTX, Full-Speed USB, Optional IEEE802.11b/802.g (WiFi),Parallel (IEEE 1284), Bluetooth (HCRP)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\r\n<td width=\"301\">698mm x 792mm x 1,213mmApprox. 210kg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Zoom</strong></td>\r\n<td width=\"301\">25% - 400% (platen) 25% - 200% (RADF)In 1% increments and pre-set ratios</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Print Resolution</strong></td>\r\n<td width=\"301\">2,400 dpi x 600 dpi (with smoothing)</td>\r\n</tr>\r\n<tr>\r\n<td width=\"301\"><strong>Scan Resolution</strong></td>\r\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\r\n</tr>\r\n</tbody>\r\n</table>", "توشيبا ستوديو 520", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\r\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\r\nالسرعة : 52 صورة فى الدقيقة\r\nحجم الورق المستخدم: A4 – A3 – A5R\r\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام\r\nالمسار الجانبى : من وزن 50 جرام حتى وزن 127 جرام\r\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\r\n+ جهاز LCC يسع 4000 ورقة\r\n+ مسار جانبى يسع 100 ورقة اساسى\r\nزمن تسخين الالة : 130 ثانية\r\nزمن اول نسخة : 7.3 ثانية\r\nالتكبير والتصغير : من 25 % الى 400 %\r\nدقة الطباعة : 600 * 2400\r\nدقة المسح 600 * 600\r\nالذاكرة: 256 ميجابيت اساسى\r\nذاكرة HDD 40 جيجابيت\r\nالإضائة : 3 مستويات تحكم فى الاضائة\r\nالتوصيلات : USB 2.0 / Network Sharing\r\nوظائف التصوير:\r\nخيار تصنيف الى (sorting option)\r\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\r\nمعدلات التشغيل: الحبر 40000 نسخة", "trash", "open", "closed", "", "%d8%aa%d9%88%d8%b4%d9%8a%d8%a8%d8%a7-%d8%b3%d8%aa%d9%88%d8%af%d9%8a%d9%88-520__trashed", "", "", "2016-07-21 03:12:18", "2016-07-21 00:12:18", "", "0", "http://madyeg.com/shop/toshiba-e-studio-520/", "0", "product", "", "0");
