INSERT INTO `egstr_posts` VALUES("978", "1", "2015-08-02 16:58:22", "2015-08-02 13:58:22", "View PDF\n<table class=\" aligncenter\" dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">52 ppm (A4, 64-163gsm)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3 –A5R (Cassettes &amp; Bypass)A4 ( Tandem Large Capacity Feeder)\n\nA4 (Large Capacity Feeder - optional)\n\nA3+ (Post-Fusing Inserter Unit – optional)\n\n&nbsp;\n\n64-209 gsm (paper supply and ADU)\n\n50 –127 gsm (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500-sheet cassettes, 2,500-sheet A4 LCF,100-sheet By-Pass\n\n4,000-sheet A4 (LCF optional)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Main Memory 256MB + Page Memory64MB – up to 320MB (shared)\n\nHDD 40GB+ (shared)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10baseT/100BaseTX, Full-Speed USB, Optional IEEE802.11b/802.g (WiFi),Parallel (IEEE 1284), Bluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698mm x 792mm x 1,213mmApprox. 210kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% - 400% (platen) 25% - 200% (RADF)In 1% increments and pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 dpi x 600 dpi (with smoothing)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\n</tr>\n</tbody>\n</table>", "Toshiba E-studio 520", "<p>ماكينة تصوير Toshiba e-Studio 520<br />\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس<br />\nالسرعة : 52 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3 – A5R<span class=\"text_exposed_show\"><br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام<br />\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام<br />\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 130 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 320 ميجابيت اساسى<br />\nالتوصيلات : USB 2.0 / Network Sharing</span></p>\n", "inherit", "open", "open", "", "895-autosave-v1", "", "", "2015-08-02 16:58:22", "2015-08-02 13:58:22", "", "895", "http://madyeg.com/895-autosave-v1/", "0", "revision", "", "0");
