INSERT INTO `egstr_posts` VALUES("1014", "1", "2015-08-24 15:50:01", "2015-08-24 12:50:01", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-523-603-723-853.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 853</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">85  ppm (A4), 33/36/37/43 ppm (A3)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassettes and Bypass: A5R-A3, 64-209 gsmTandem Large Capacity Feeder and optionalLarge Capacity Feeder: A4, 64-209 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500 sheets (Cassettes), 2,500 sheets A4(Tandem Large Capacity Feeder),100 sheets (Bypass)Note: 72 ppm system is alternatively available with4 x 500 sheet (Cassettes), 100 sheets (Bypass)Maximum: 7,600 sheets</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">A5R-A3, 64-209 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Toshiba e-BRIDGE</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">40 GB HDD / 320 MB RAM (max. 576 MB)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10/100BaseT (incl. IPv6), Full-speed USB,WLAN1 (IEEE802.11b/g), Bluetooth1</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698 x 789 x 1,213 mm (W x D x H), ~ 210 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">Max. 2,400 x 600 dpi (with smoothing), 8 bit</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, mono, 8 bit in Grayscale</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 853", "الامكانية: كوبير + برنتر + سكنر + فيدر + دوبلكس Network +  USB\nانتاجية طباعة وتصوير حتى 35000 نسخة شهريا\nالسرعة : 85 صورة فى الدقيقة (A4)33/36/37/43 صورة في الدقيقة(A3)\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n+ جهاز LCC يسع 4000 ورقة\n+ مسار جانبى يسع 100 ورقة اساسى\nزمن تسخين الالة : 130 ثانية\nزمن اول نسخة : 7.3 ثانية\nالتكبير والتصغير : من 25 % الى 400 %\nدقة الطباعة : 600 * 2400\nدقة المسح 600 * 600\nالذاكرة: 320 ميجابيت اساسى\nذاكرة HDD 80 جيجابيت\nالإضائة : 3 مستويات تحكم فى الاضائة\nالتوصيلات : USB 2.0 / Network Sharing\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة)- وظيفة الارقام الكودية - وظيفة الفرز\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\nمعدلات التشغيل: الحبر 40000 نسخة\n\n", "inherit", "open", "open", "", "908-autosave-v1", "", "", "2015-08-24 15:50:01", "2015-08-24 12:50:01", "", "908", "http://madyeg.com/908-autosave-v1/", "0", "revision", "", "0");
