INSERT INTO `egstr_posts` VALUES("1016", "1", "2015-10-20 17:03:19", "2015-10-20 14:03:19", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-520-600-720-850.pdf\" target=\"_blank\"><img class=\"  wp-image-1013 alignnone\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"177\" height=\"51\" /></a>\n<table dir=\"ltr\" style=\"height: 731px;\" width=\"599\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 720</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">72 ppm (A4, 64-163gsm)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3 –A5R (Cassettes &amp; Bypass)A4 ( Tandem Large Capacity Feeder)A4 (Large Capacity Feeder - optional)A3+ (Post-Fusing Inserter Unit – optional)64-209 gsm (paper supply and ADU)50 –127 gsm (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500-sheet cassettes, 2,500-sheet A4 LCF,100-sheet By-Pass4,000-sheet A4 (LCF optional)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Main Memory 256MB + Page Memory64MB – up to 320MB (shared)HDD 40GB+ (shared)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10baseT/100BaseTX, Full-Speed USB, Optional IEEE802.11b/802.g (WiFi),Parallel (IEEE 1284), Bluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698mm x 792mm x 1,213mmApprox. 210kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% - 400% (platen) 25% - 200% (RADF)In 1% increments and pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 dpi x 600 dpi (with smoothing)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 720", "<p>الامكانية: كوبير + برنتر + سكنر + فيدر + دوبلكس<br />\nانتاجية طباعة وتصوير حتى 15000 نسخة شهريا<br />\nالسرعة : 55 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3 – A5R<br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام<br />\nالمسار الجانبى : من وزن 50 جرام حتى وزن 127 جرام<br />\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 130 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 256 ميجابيت اساسى<br />\nذاكرة HDD 40 جيجابيت<br />\nالإضائة : 3 مستويات تحكم فى الاضائة<br />\nالتوصيلات : USB 2.0 / Network Sharing<br />\nوظائف التصوير:<br />\nخيار تصنيف الى (sorting option)<br />\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة)- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور<br />\nمعدلات التشغيل: الحبر 40000 نسخة</p>\n", "inherit", "open", "open", "", "905-autosave-v1", "", "", "2015-10-20 17:03:19", "2015-10-20 14:03:19", "", "905", "http://madyeg.com/905-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1017", "1", "2015-08-24 15:34:34", "2015-08-24 12:34:34", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-520-600-720-850.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 850</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">85 ppm (A4, 64-163gsm)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3 –A5R (Cassettes &amp; Bypass)A4 ( Tandem Large Capacity Feeder)A4 (Large Capacity Feeder - optional)A3+ (Post-Fusing Inserter Unit – optional)64-209 gsm (paper supply and ADU)50 –127 gsm (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500-sheet cassettes, 2,500-sheet A4 LCF,100-sheet By-Pass4,000-sheet A4 (LCF optional)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Main Memory 256MB + Page Memory64MB – up to 320MB (shared)HDD 40GB+ (shared)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10baseT/100BaseTX, Full-Speed USB, Optional IEEE802.11b/802.g (WiFi),Parallel (IEEE 1284), Bluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698mm x 792mm x 1,213mmApprox. 210kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% - 400% (platen) 25% - 200% (RADF)In 1% increments and pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 dpi x 600 dpi (with smoothing)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 850", "<p>الامكانية: كوبير + برنتر + سكنر + فيدر + دوبلكس<br />\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا<br />\nالسرعة : 85 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3 – A5R<br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام<br />\nالمسار الجانبى : من وزن 50 جرام حتى وزن 127 جرام<br />\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى<br />\n+ جهاز LCC يسع 4000 ورقة<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 130 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 256 ميجابيت اساسى<br />\nذاكرة HDD 40 جيجابيت<br />\nالإضائة : 3 مستويات تحكم فى الاضائة<br />\nالتوصيلات : USB 2.0 / Network Sharing<br />\nوظائف التصوير:<br />\n(Sorting optionخيار تصنيف الى (<br />\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج) حذف – اضافة (- وظيفة الارقام الكودية - وظيفة الفرز<br />\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور<br />\nمعدلات التشغيل: الحبر 40000 نسخة</p>\n", "inherit", "open", "open", "", "904-autosave-v1", "", "", "2015-08-24 15:34:34", "2015-08-24 12:34:34", "", "904", "http://madyeg.com/904-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1018", "1", "2015-08-24 15:52:32", "2015-08-24 12:52:32", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/e-STUDIO855SEBrochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 755</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">75  cpm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Appx. 130 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassette: Statement-R to Ledger (17-110 lbs.)Bypass: Statement-R to 11” x 17” (17-110 lbs.)LCF: Letter Only (17-110 lbs.)Std. Bond, Post CardTab Sheets - Bypass + 1/2 Drawers</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard Paper Supply 2 x 500-Sheet Drawer; 1 x 2,500-Sheet Tandem Drawer;100-Sheet Stack Feed BypassMaximum Paper Supply Up to 7,600 Sheets (w/Optional 4,000-Sheet LCF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">-</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">8.5” Wide VGA Color Touch-Screen</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">1GB RAM, 60 GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Ethernet 10/100BaseTUSB 2.0, 802.11b/g Wirelesss LANBluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">Appx. 28” x 31” x 46” (W x D x H)Appx. 462 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400%</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 755", "الامكانية: كوبير + برنتر + سكنر + فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\nالسرعة : 75 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\n\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\n\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n\n+ جهاز LCC يسع 4000 ورقة\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 130 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 1 جيجابيت اساسى\n\nذاكرة HDD 60 جيجابيت\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\n\n(Sorting optionخيار تصنيف الى (\n\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج) حذف – اضافة (- وظيفة الارقام الكودية - وظيفة الفرز\n\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "901-autosave-v1", "", "", "2015-08-24 15:52:32", "2015-08-24 12:52:32", "", "901", "http://madyeg.com/901-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1019", "1", "2015-08-24 15:53:29", "2015-08-24 12:53:29", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/e-STUDIO855SEBrochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 655</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">65  cpm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Appx. 130 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassette: Statement-R to Ledger (17-110 lbs.)Bypass: Statement-R to 11” x 17” (17-110 lbs.)LCF: Letter Only (17-110 lbs.)Std. Bond, Post CardTab Sheets - Bypass + 1/2 Drawers</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard Paper Supply 2 x 500-Sheet Drawer; 1 x 2,500-Sheet Tandem Drawer;100-Sheet Stack Feed BypassMaximum Paper Supply Up to 7,600 Sheets (w/Optional 4,000-Sheet LCF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">-</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">8.5” Wide VGA Color Touch-Screen</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">1GB RAM, 60 GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Ethernet 10/100BaseTUSB 2.0, 802.11b/g Wirelesss LANBluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">Appx. 28” x 31” x 46” (W x D x H)Appx. 462 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400%</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 655", "ماكينة تصوير Toshiba e-Studio 655\n\nالامكانية: كوبير + برنتر + سكنر + فيدر + دوبلكس\n\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\n\nالسرعة : 65 صورة فى الدقيقة\n\nحجم الورق المستخدم: A4 – A3 – A5R\n\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\n\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\n\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n\n+ جهاز LCC يسع 4000 ورقة\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 130 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 1 جيجابيت اساسى\n\nذاكرة HDD 60 جيجابيت\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\n\n(Sorting optionخيار تصنيف الى (\n\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج) حذف – اضافة (- وظيفة الارقام الكودية - وظيفة الفرز\n\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "900-autosave-v1", "", "", "2015-08-24 15:53:29", "2015-08-24 12:53:29", "", "900", "http://madyeg.com/900-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1020", "1", "2015-08-24 15:54:22", "2015-08-24 12:54:22", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/e-STUDIO855SEBrochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 555</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">55  cpm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Appx. 130 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassette: Statement-R to Ledger (17-110 lbs.)Bypass: Statement-R to 11” x 17” (17-110 lbs.)LCF: Letter Only (17-110 lbs.)Std. Bond, Post CardTab Sheets - Bypass + 1/2 Drawers</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard Paper Supply 2 x 500-Sheet Drawer; 1 x 2,500-Sheet Tandem Drawer;100-Sheet Stack Feed BypassMaximum Paper Supply Up to 7,600 Sheets (w/Optional 4,000-Sheet LCF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">-</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">8.5” Wide VGA Color Touch-Screen</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">1GB RAM, 60 GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Ethernet 10/100BaseTUSB 2.0, 802.11b/g Wirelesss LANBluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">Appx. 28” x 31” x 46” (W x D x H)Appx. 462 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400%</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 555", "الامكانية: كوبير + برنتر + سكنر + فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\nالسرعة : 55 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\n\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n\n+ جهاز LCC يسع 4000 ورقة\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 130 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 1 جيجابيت اساسى\n\nذاكرة HDD 60 جيجابيت\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\n\n(Sorting optionخيار تصنيف الى (\n\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج) حذف – اضافة (- وظيفة الارقام الكودية - وظيفة الفرز\n\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "899-autosave-v1", "", "", "2015-08-24 15:54:22", "2015-08-24 12:54:22", "", "899", "http://madyeg.com/899-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1021", "1", "2015-08-24 15:56:12", "2015-08-24 12:56:12", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-523-603-723-853.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" width=\"601\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 603</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">60   ppm (A4), 33/36/37/43 ppm (A3)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassettes and Bypass: A5R-A3, 64-209 gsmTandem Large Capacity Feeder and optionalLarge Capacity Feeder: A4, 64-209 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500 sheets (Cassettes), 2,500 sheets A4(Tandem Large Capacity Feeder),100 sheets (Bypass)Note: 72 ppm system is alternatively available with4 x 500 sheet (Cassettes), 100 sheets (Bypass)Maximum: 7,600 sheets</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">A5R-A3, 64-209 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Toshiba e-BRIDGE</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">40 GB HDD / 320 MB RAM (max. 576 MB)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10/100BaseT (incl. IPv6), Full-speed USB,WLAN1 (IEEE802.11b/g), Bluetooth1</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698 x 789 x 1,213 mm (W x D x H), ~ 210 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">Max. 2,400 x 600 dpi (with smoothing), 8 bit</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, mono, 8 bit in Grayscale</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 603", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\nالسرعة : 60 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام\nالمسار الجانبى : من وزن 50 جرام حتى وزن 127 جرام\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n+ جهاز LCC يسع 4000 ورقة\n+ مسار جانبى يسع 100 ورقة اساسى\nزمن تسخين الالة : 130 ثانية\nزمن اول نسخة : 7.3 ثانية\nالتكبير والتصغير : من 25 % الى 400 %\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 320 ميجابيت اساسى\n\nذاكرة HDD 40 جيجابيت\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\n\n(Sorting optionخيار تصنيف الى (\n\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج) حذف – اضافة (- وظيفة الارقام الكودية - وظيفة الفرز\n\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "898-autosave-v1", "", "", "2015-08-24 15:56:12", "2015-08-24 12:56:12", "", "898", "http://madyeg.com/898-autosave-v1/", "0", "revision", "", "0");
