INSERT INTO `egstr_posts` VALUES("1023", "1", "2015-08-24 16:03:08", "2015-08-24 13:03:08", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-520-600-720-850.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 600</td>\n</tr>\n<tr>\n<td style=\"text-align: left;\" width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td style=\"text-align: left;\" width=\"301\">60  ppm (A4, 64-163gsm)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3 –A5R (Cassettes &amp; Bypass)A4 ( Tandem Large Capacity Feeder)A4 (Large Capacity Feeder - optional)A3+ (Post-Fusing Inserter Unit – optional)64-209 gsm (paper supply and ADU)50 –127 gsm (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500-sheet cassettes, 2,500-sheet A4 LCF,100-sheet By-Pass4,000-sheet A4 (LCF optional)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Main Memory 256MB + Page Memory64MB – up to 320MB (shared)HDD 40GB+ (shared)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10baseT/100BaseTX, Full-Speed USB, Optional IEEE802.11b/802.g (WiFi),Parallel (IEEE 1284), Bluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698mm x 792mm x 1,213mmApprox. 210kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% - 400% (platen) 25% - 200% (RADF)In 1% increments and pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 dpi x 600 dpi (with smoothing)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 600", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\nالسرعة : 60 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام\nالمسار الجانبى : من وزن 50 جرام حتى وزن 127 جرام\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n+ جهاز LCC يسع 4000 ورقة\n+ مسار جانبى يسع 100 ورقة اساسى\nزمن تسخين الالة : 130 ثانية\nزمن اول نسخة : 7.3 ثانية\nالتكبير والتصغير : من 25 % الى 400 %\nدقة الطباعة : 600 * 2400\nدقة المسح 600 * 600\nالذاكرة: 320 ميجابيت اساسى\nذاكرة HDD 40 جيجابيت\nالإضائة : 3 مستويات تحكم فى الاضائة\nالتوصيلات : USB 2.0 / Network Sharing\nوظائف التصوير:\n\n(Sorting optionخيار تصنيف الى (\n\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج) حذف – اضافة (- وظيفة الارقام الكودية - وظيفة الفرز\n\nالالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "896-autosave-v1", "", "", "2015-08-24 16:03:08", "2015-08-24 13:03:08", "", "896", "http://madyeg.com/896-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1024", "1", "2015-08-24 16:06:32", "2015-08-24 13:06:32", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-520-600-720-850.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 520</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">52 ppm (A4, 64-163gsm)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 130 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3 –A5R (Cassettes &amp; Bypass)A4 ( Tandem Large Capacity Feeder)A4 (Large Capacity Feeder - optional)A3+ (Post-Fusing Inserter Unit – optional)64-209 gsm (paper supply and ADU)\n\n50 –127 gsm (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 500-sheet cassettes, 2,500-sheet A4 LCF,100-sheet By-Pass4,000-sheet A4 (LCF optional)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\"></td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Main Memory 256MB + Page Memory64MB – up to 320MB (shared)HDD 40GB+ (shared)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10baseT/100BaseTX, Full-Speed USB, Optional IEEE802.11b/802.g (WiFi),Parallel (IEEE 1284), Bluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">698mm x 792mm x 1,213mmApprox. 210kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% - 400% (platen) 25% - 200% (RADF)In 1% increments and pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 dpi x 600 dpi (with smoothing)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 520", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 150000 نسخة شهريا\nالسرعة : 52 صورة فى الدقيقة\n\nحجم الورق المستخدم: A4 – A3 – A5R\n\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 209 جرام\n\nالمسار الجانبى : من وزن 50 جرام حتى وزن 127 جرام\n\nادراج الورق : عدد 2 درج اساسى 500 ورقة اساسى\n\n+ جهاز LCC يسع 4000 ورقة\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 130 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 256 ميجابيت اساسى\n\nذاكرة HDD 40 جيجابيت\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "895-autosave-v1", "", "", "2015-08-24 16:06:32", "2015-08-24 13:06:32", "", "895", "http://madyeg.com/895-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1025", "1", "2015-08-09 16:45:24", "2015-08-09 13:45:24", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/e-studio280.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 230</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">23 PPM (Letter)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approximately 25 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Statement-R (5.5\" x 8.5\") to Ledger (11\" x 17\"), 17-28 lbs.;Stack Feed Bypass 17-53 lbs. (110 lbs. Index)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 Standard Cassettes @ 550 Sheets (17-28 lbs.);100-Sheet Stack Feed Bypass</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Simplex &amp; Duplex Printing Available</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Indirect Electrostatic Photographic Method (Dry Process)Laser Electronic</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">128 MB, 40 GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Graphic Display; Icon Based LCD Touch Panel; Key Top</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">25.1” x 28.15” x 29.09” (W x D x H)Approximately 165 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400%</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2400 x 600 dpi/256 Gradations</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 230", "<p>ماكينة تصوير Toshiba e-Studio 230<br />\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس<br />\nالسرعة : 23 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3 – A5R<span class=\"text_exposed_show\"><br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام<br />\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام<br />\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 25 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 128 ميجابيت اساسى<br />\nالتوصيلات : USB 2.0 / Network Sharing</span></p>\n", "inherit", "open", "open", "", "99-autosave-v1", "", "", "2015-08-09 16:45:24", "2015-08-09 13:45:24", "", "99", "http://madyeg.com/99-autosave-v1/", "0", "revision", "", "0");
