INSERT INTO `egstr_posts` VALUES("1028", "1", "2015-08-24 16:20:59", "2015-08-24 13:20:59", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio232-282-printer-specifications-brochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 282</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">28 ppm (A4)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 25 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3–A5R64-105 gsm (Drawer, Duplex, LCF*)64-209 gsm (Bypass)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard: 2 x 550 sheets (Drawer),100 sheets (Bypass)Maximum: 3,700 sheets</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Stackless (standard)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Desktop</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Standard 40+ GB (shared)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">User Interface (including Dual-Function)Standard: 10BaseT/100BaseTX, Full-speedUSBOptional: IEEE802.11b/802.11g (WiFi),Bluetooth</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">637 x 715 x 739 mmApprox. 74.8 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25%-400% (Platen), 25%-200% (RADF*)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 x 600 dpi (with smoothing)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600, 400, 300, 200, 150 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 282", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\nالسرعة : 28 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R - B4 - B5\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 25 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 40 جيجابيت اساسى\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "87-autosave-v1", "", "", "2015-08-24 16:20:59", "2015-08-24 13:20:59", "", "87", "http://madyeg.com/87-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1029", "1", "2015-08-24 17:08:09", "2015-08-24 14:08:09", "<p><a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio233-283-printer-brochure.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a></p>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 283</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">28  ppm (A4), 16 ppm (A3)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 25 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassettes: A5R-A3, 64-105 gsmLarge Capacity Feeder 1: A4, 64-105 gsmBypass: A5R-A3, 50-209 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 x 550 sheets (Cassettes), 100 sheets (Bypass)Maximum: 3,700 sheets</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">A5R-A3, 64-105 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Toshiba e-BRIDGE</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">40 GB HDD / 288 MB RAM (max. 544 MB)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10/100BaseT (incl. IPv6), Full-speed USB,WLAN 1 (IEEE802.11b/g), Bluetooth</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">637 x 719 x 739 mm (W x D x H), ~ 76.6 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">Max. 2,400 x 600 dpi (with smoothing), 8 bit</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, mono</td>\n</tr>\n</tbody>\n</table>\n", "توشيبا ستوديو 283", "<p>الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس<br />\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا<br />\nالسرعة : 28 صورة فى الدقيقة(A4)<br />\n16 صورة في الدقيقة(A3)<br />\nحجم الورق المستخدم: A4 – A3 – A5R - B4 - B5<br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام<br />\nالمسار الجانبى : من وزن 50 جرام حتى وزن 209 جرام<br />\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 25 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 288 ميجابيت اساسى<br />\nالإضائة : 3 مستويات تحكم فى الاضائة<br />\nالتوصيلات : USB 2.0 / Network Sharing<br />\nوظائف التصوير:<br />\nخيار تصنيف الى (sorting option)<br />\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور<br />\nمعدلات التشغيل: الحبر 40000 نسخة</p>\n", "inherit", "open", "open", "", "83-autosave-v1", "", "", "2015-08-24 17:08:09", "2015-08-24 14:08:09", "", "83", "http://madyeg.com/83-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1030", "1", "2015-10-23 00:19:50", "2015-10-22 21:19:50", "توشيبا ستوديو 350 Toshiba E-studio\n\n<img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" />\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 350</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">35  PPM (Letter)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approximately 20 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Statement-R (5.5\" x 8.5\") to Ledger(11\" x 17\"), 17-28 lbs.; Stack Feed “Smart”Bypass 17-53 lbs. (110 lbs. Index)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 Standard Cassettes @ 550 Sheets(17-28 lbs.); 100-Sheet Bypass</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Duplex Originals (13-28 lbs.)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Automatic Toner Density Monitoringand Dispensing from Toner Cartridge</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">128 MB, 40+ GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Graphic Display; Icon Based LCDTouch Panel; Key Top</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">26” x 28” x 29” (W x D x H)Approximately 177 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400%</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi,600 dpi</td>\n</tr>\n</tbody>\n</table>\n&nbsp;", "توشيبا ستوديو 350", "<p>ماكينة تصوير توشيبا ستوديو 350 Toshiba E studio</p>\n<p>الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس<br />\nانتاجية طباعة وتصوير حتى 10000 نسخة شهريا<br />\nالسرعة : 35 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3 – A5R<br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام<br />\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام<br />\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 20 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 128 ميجابيت اساسى<br />\nالإضائة : 3 مستويات تحكم فى الاضائة<br />\nالتوصيلات : USB 2.0 / Network Sharing<br />\nوظائف التصوير:<br />\nخيار تصنيف الى (sorting option)<br />\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور<br />\nمعدلات التشغيل: الحبر 40000 نسخة</p>\n", "inherit", "open", "open", "", "79-autosave-v1", "", "", "2015-10-23 00:19:50", "2015-10-22 21:19:50", "", "79", "http://madyeg.com/79-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1031", "1", "2015-08-25 13:53:58", "2015-08-25 10:53:58", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-450-346.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 450</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">45 PPM (Letter)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approximately 20 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Statement-R (5.5\" x 8.5\") to Ledger(11\" x 17\"), 17-28 lbs.; Stack Feed “Smart”Bypass 17-53 lbs. (110 lbs. Index)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">2 Standard Cassettes @ 550 Sheets(17-28 lbs.); 100-Sheet Bypass</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Duplex Originals (13-28 lbs.)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Automatic Toner Density Monitoringand Dispensing from Toner Cartridge</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">128 MB, 40+ GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Graphic Display; Icon Based LCDTouch Panel; Key Top</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">26” x 28” x 29” (W x D x H)Approximately 177 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400%</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">150 dpi, 200 dpi, 300 dpi, 400 dpi,600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 450", "الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\nالسرعة : 45 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 20 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 128 ميجابيت اساسى\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "76-autosave-v1", "", "", "2015-08-25 13:53:58", "2015-08-25 10:53:58", "", "76", "http://madyeg.com/76-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1032", "1", "2015-12-06 17:42:09", "2015-12-06 14:42:09", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-163-203-165-205.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 203</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">20 ppm (A4)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 25 sec.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">A3-B5 (Drawer), A3-A5R (Bypass/ADF*)64-80 gsm (Drawer/Bypass Multi feed), 50-163 gsm (Bypass Single feed)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard 1 x 250 sheet Drawer + 100 sheet BypassMaximum 2 x 250 sheet Drawer + 100 sheet Bypass</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">----</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">----</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">16 MB / 80 MB</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">----</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">600 x 643 x 463 mm32 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-200% (1% increments), various pre-set ratios</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">2,400 x 600 dpi</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600 dpi. 300 dpi</td>\n</tr>\n</tbody>\n</table>\n", "توشيبا ستوديو 203", "<p>الامكانية: كوبير + برنتر + سكنر+ فيدر + دوبلكس<br />\nانتاجية طباعة وتصوير حتى 50000 نسخة شهريا<br />\nالسرعة : 20 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3-B5 – A5R<br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 80 جرام<br />\nالمسار الجانبى : من وزن 50 جرام حتى وزن 163 جرام<br />\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 25 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 300 * 600<br />\nالذاكرة: 16 ميجابيت اساسى<br />\nالإضائة : 3 مستويات تحكم فى الاضائة<br />\nالتوصيلات : USB 2.0 / Network Sharing<br />\nوظائف التصوير:<br />\nخيار تصنيف الى (sorting option)<br />\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور<br />\nمعدلات التشغيل: الحبر 35000 نسخة</p>\n", "inherit", "open", "open", "", "73-autosave-v1", "", "", "2015-12-06 17:42:09", "2015-12-06 14:42:09", "", "73", "http://madyeg.com/73-autosave-v1/", "0", "revision", "", "0");
