INSERT INTO `egstr_posts` VALUES("1036", "1", "2015-08-09 17:07:08", "2015-08-09 14:07:08", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-452-352.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio 352</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">35 PPM (Letter)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 20 Seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassette: Statement-R to Ledger (17-28 lbs.)Bypass: Statement-R to 12” x 18” (17-110 lbs.)LCF: Letter (17-28 lbs.)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Up to 3,700 Sheet Input CapacityStandard: 2 x 550 Sheet Cassettes (17-28 lbs.)Optional: 1 x 550 Sheet PFP, 1 x 550 Sheet Cassette,1 x 2,500 Sheet LCF</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">2-in-1, 4-in-1, 8-in-1 Duplex</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Half VGA Tiltable LCD Touch Panel, Key Top</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">Main Memory: 256 MB / Page Memory: 32MB / 40GB HDD</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10BaseT/100BaseTX Ethernet, 802.11b/gWireless LAN, USB, Bluetooth (HCRP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">Approx. 26\" x 28\" x 29\" (W x D x H)Approx. 83 lbs.</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td wi