0BASE-T), USB 2.0/Hi Speed USB ,Wireless LAN (option), Bluetooth (option)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">W575 x D586 x H756mm (22.6˝ x 23 ˝ x 29.8 ˝)Approx. 60kg (with drum and developer)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400% in 1% increment (Platen)25% to 200% in 1% increment (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">600 dpi x 600 dpi, 1 bit2,400 dpi x 600 dpi, with smoothing</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">100 dpi, 150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>\n", "توشيبا ستوديو 355", "<p>ماكينة تصوير توشيبا ستوديو 355<br />\nالامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس<br />\nالسرعة : 35 صورة فى الدقيقة<br />\nحجم الورق المستخدم: A4 – A3 – A5R<span class=\"text_exposed_show\"><br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام<br />\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام<br />\nادراج الورق : عدد 2 درج اساسى 250 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 20 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 2400<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 1 جيجابيت اساسى<br />\nالتوصيلات : USB 2.0 / Network Sharing</span></p>\n", "inherit", "open", "open", "", "53-autosave-v1", "", "", "2015-08-10 11:48:20", "2015-08-10 08:48:20", "", "53", "http://madyeg.com/53-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1038", "1", "2015-08-25 14:14:42", "2015-08-25 11:14:42", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-255-305.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 255</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">25 ppm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. 20 seconds</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Drawers: A3/A4/A5-RStack Feed Bypass: A3/A4/A5-RLarge Capacity Feeder (Pedestal type): A4Paper Feed Pedestal: A3/A5-RDrawers: 64 - 105 g/m\n\nStack Feed Bypass (Multi-feed): 64 - 209 g/m2\n\nStack Feed Bypass (Single-feed): 52 - 209 g/m2\n\nLarge Capacity Feeder (Pedestal type): 64 - 105 g/m\n\nPaper Feed Pedestal: 64 - 105 g/m2</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">With 80 g/m2Standard 1200 sheets Drawer 1 (550 sheets), Drawer 2 (550 sheets),Stack Feed Bypass (100 sheets)Max 3200 sheets Drawer 1 (550 sheets), Drawer 2 (550 sheets),Large Capacity Feeder (2,000), Stack Feed Bypass (100 sheets)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Standard Trayless automatic duplex unit</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">1 beam laser printing (Memory copy standard)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">RAM: 1GB (Unified with Page and Main Memory)HDD: 60GB+ (Shared for all imaging functions)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Ethernet (10/100BASE-T), USB 2.0/Hi Speed USB,Wireless LAN (option), Bluetooth (option)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">W575 x D586 x H756mm, (22.6˝ x 23 ˝ x 29.8 ˝)Approx. 57kg (with drum and developer)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400% in 1% increment (Platen)25% to 200% in 1% increment (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">600 dpi x 600 dpi, 1 bit2,400 dpi x 600 dpi, with smoothing</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">100 dpi, 150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 255", "الامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\nالسرعة : 25 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\n\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\n\nادراج الورق : عدد 2 درج اساسى 1200 ورقة اساسى\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 20 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 1 جيجابيت اساسى\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "50-autosave-v1", "", "", "2015-08-25 14:14:42", "2015-08-25 11:14:42", "", "50", "http://madyeg.com/50-autosave-v1/", "0", "revision", "", "0");
