Speed USB ,Wireless LAN (option), Bluetooth (option)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">W575 x D586 x H756mm (22.6˝ x 23 ˝ x 29.8 ˝)Approx. 60kg (with drum and developer)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400% in 1% increment (Platen)25% to 200% in 1% increment (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">600 dpi x 600 dpi, 1 bit2,400 dpi x 600 dpi, with smoothing</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">100 dpi, 150 dpi, 200 dpi, 300 dpi, 400 dpi, 600 dpi</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 455", "الامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا\nالسرعة : 45 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A3 – A5R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 105 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 209 جرام\nادراج الورق : عدد 2 درج اساسى 1200 ورقة اساسى\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 20 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 2400\n\nدقة المسح 600 * 600\n\nالذاكرة: 1 جيجابيت اساسى\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 40000 نسخة", "inherit", "open", "open", "", "47-autosave-v1", "", "", "2015-08-25 14:16:43", "2015-08-25 11:16:43", "", "47", "http://madyeg.com/47-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1040", "1", "2015-08-25 14:18:32", "2015-08-25 11:18:32", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-5520c-6520c.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 5520</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">55 ppm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. &lt;70 seconds from low-power mode</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassettes: A5R-320 x 460 mm, 64-256 gsmTandem LCF2): A4, 64-256 gsmBypass: A6R-13” x 19”, 64-300 gsm,banner paper 313 x 1,200 mm, 64-256 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">(Cassettes) + 2,320 sheets (Tandem LCF)2),100 sheets (Bypass)Maximum: 6,0002) sheets with external LCF1)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Up to 320 x 460 mm and 256 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Toshiba e-BRIDGE</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">80 GB HDD, 2.0 GB RAM</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10/100/1000BaseT (incl. IPv6), High-SpeedUSB 2.0, WLAN1) (IEEE802.11b/g), Bluetooth1)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">980 x 698 x 1,540 mm (W x D x H), ~ 246 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, 8 bit per channelMax. 1,200 x 1,200 dpi, 2 bit per channel3)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, 8 bit per channel</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 5520", "الامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\nانتاجية طباعة وتصوير حتى 200000 نسخة شهريا\nالسرعة : 55 صورة فى الدقيقة\nحجم الورق المستخدم: A4 – A5R - A6R\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 256 جرام\nالمسار الجانبى : من وزن 64 جرام حتى وزن 256 جرام\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 70 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 600\n\nدقة المسح 600 * 600\n\nالذاكرة:2 جيجابيت اساسى\n\nذاكرة HDD 80 جيجابيت\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 15000 نسخة", "inherit", "open", "open", "", "40-autosave-v1", "", "", "2015-08-25 14:18:32", "2015-08-25 11:18:32", "", "40", "http://madyeg.com/40-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1041", "1", "2015-08-25 14:20:41", "2015-08-25 11:20:41", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-5520c-6520c.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba E-studio توشيبا ستوديو 6520</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">65 ppm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx. &lt;70 seconds from low-power mode</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Cassettes: A5R-320 x 460 mm, 64-256 gsmTandem LCF2): A4, 64-256 gsmBypass: A6R-13” x 19”, 64-300 gsm,banner paper 313 x 1,200 mm, 64-256 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">(Cassettes) + 2,320 sheets (Tandem LCF)2),100 sheets (Bypass)Maximum: 6,0002) sheets with external LCF1)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">Up to 320 x 460 mm and 256 gsm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Toshiba e-BRIDGE</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">80 GB HDD, 2.0 GB RAM</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">10/100/1000BaseT (incl. IPv6), High-SpeedUSB 2.0, WLAN1) (IEEE802.11b/g), Bluetooth1)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">980 x 698 x 1,540 mm (W x D x H), ~ 246 kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25-400% (platen glass), 25-200% (RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, 8 bit per channelMax. 1,200 x 1,200 dpi, 2 bit per channel3)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">Max. 600 x 600 dpi, 8 bit per channel</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 6520", "الامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس\n\nانتاجية طباعة وتصوير حتى 200000 نسخة شهريا\n\nالسرعة : 65 صورة فى الدقيقة\n\nحجم الورق المستخدم: A4 – A5R - A6R\n\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 256 جرام\n\nالمسار الجانبى : من وزن 64 جرام حتى وزن 280 جرام\n\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى\n\n+ مسار جانبى يسع 100 ورقة اساسى\n\nزمن تسخين الالة : 70 ثانية\n\nزمن اول نسخة : 7.3 ثانية\n\nالتكبير والتصغير : من 25 % الى 400 %\n\nدقة الطباعة : 600 * 600\n\nدقة المسح 600 * 600\n\nالذاكرة:2 جيجابيت اساسى\n\n80 جيجابيت HDD\n\nالإضائة : 3 مستويات تحكم فى الاضائة\n\nالتوصيلات : USB 2.0 / Network Sharing\n\nوظائف التصوير:\nخيار تصنيف الى (sorting option)\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور\n\nمعدلات التشغيل: الحبر 15000 نسخة", "inherit", "open", "open", "", "37-autosave-v1", "", "", "2015-08-25 14:20:41", "2015-08-25 11:20:41", "", "37", "http://madyeg.com/37-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `egstr_posts` VALUES("1042", "1", "2015-08-25 14:25:38", "2015-08-25 11:25:38", "<a href=\"http://madyeg.com/wp-content/uploads/2015/08/toshiba-e-studio-2330c_2820c_3520c_4520c.pdf\" target=\"_blank\"><img class=\"alignnone size-full wp-image-1013\" src=\"http://madyeg.com/wp-content/uploads/2015/07/view-pdf.png\" alt=\"view pdf\" width=\"208\" height=\"60\" /></a>\n<table dir=\"ltr\" style=\"height: 683px;\" width=\"583\">\n<tbody>\n<tr>\n<td width=\"301\"><strong>Model </strong></td>\n<td width=\"301\">Toshiba e-Studio 3520 color توشيبا ستوديو 3520</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print &amp; Copy Speed</strong></td>\n<td width=\"301\">35 ppm</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Warm-up Time</strong></td>\n<td width=\"301\">Approx.89 sec</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Size &amp; Weight</strong></td>\n<td width=\"301\">Drawers: A5-R — A3, 64 — 256g/m2Stack Feed Bypass: A6-R — 320 x 460mm, 64 — 280g/m2</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Paper Capacity</strong></td>\n<td width=\"301\">Standard: 550 sheets x 2 (Drawer), 100 sheets (Stack Feed Bypass)Optional: 2,500 sheets (LCF) or 550 sheets (Paper Feed Pedestal),550 sheets (Drawer for PFP)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Automatic Duplex</strong></td>\n<td width=\"301\">2-in-1, 4-in-1, 8-in-1 Duplex</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Controller Type</strong></td>\n<td width=\"301\">Desktop</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Memory</strong></td>\n<td width=\"301\">80GB (Shared) / Main memory: 1GB, Page Memory: 512MB</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Interface</strong></td>\n<td width=\"301\">Standard: 10/100/baseT, USB 2.0/(Hi Speed USB)Option: IEEE802.11b/g (Wireless LAN module),</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Dimensions &amp; Weight</strong></td>\n<td width=\"301\">699 x 774 x 759mm (W/ADU and SFB: Std.)Approx. 123kg</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Zoom</strong></td>\n<td width=\"301\">25% to 400% (1% Increment) (Glass)25% to 200% (1% Increment) (Original on RADF)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Print Resolution</strong></td>\n<td width=\"301\">600 x 600 dpi, 8 bit (Full colour)</td>\n</tr>\n<tr>\n<td width=\"301\"><strong>Scan Resolution</strong></td>\n<td width=\"301\">600 x 600 dpi, (10 bit/1024 levels)</td>\n</tr>\n</tbody>\n</table>", "توشيبا ستوديو 3520", "<p>الامكانية: كوبير + برنتر + سكنر الوان+ فيدر + دوبلكس<br />\nانتاجية طباعة وتصوير حتى 100000 نسخة شهريا<br />\nالسرعة : 35 صورة فى الدقيقة<br />\nحجم الورق المستخدم:   A4 – A3 – A5R - A6R<br />\nوزن الورق: الادراج : من وزن 64 جرام حتى وزن 256 جرام<br />\nالمسار الجانبى : من وزن 64 جرام حتى وزن 280 جرام<br />\nادراج الورق : عدد 2 درج اساسى 550 ورقة اساسى<br />\n+ مسار جانبى يسع 100 ورقة اساسى<br />\nزمن تسخين الالة : 89 ثانية<br />\nزمن اول نسخة : 7.3 ثانية<br />\nالتكبير والتصغير : من 25 % الى 400 %<br />\nدقة الطباعة : 600 * 600<br />\nدقة المسح 600 * 600<br />\nالذاكرة: 1 جيجابيت اساسى<br />\nالإضائة : 3 مستويات تحكم فى الاضائة<br />\nالتوصيلات : USB 2.0 / Network Sharing<br />\nوظائف التصوير:<br />\nخيار تصنيف الى (sorting option)<br />\nوظيفة حفظ الطاقة – وظيفة عمل المونتاج( حذف – اضافة )- وظيفة الارقام الكودية - وظيفة الفرز الالكترونى - وظيفة الترحيل التبادلى - وظيفة التكبير والتصغير Y zoom X - وظيفة دمج الصور<br />\nمعدلات التشغيل: الحبر 10000 نسخة</p>\n", "inherit", "open", "open", "", "34-autosave-v1", "", "", "2015-08-25 14:25:38", "2015-08-25 11:25:38", "", "34", "http://madyeg.com/34-autosave-v1/", "0", "revision", "", "0");
