INSERT INTO `egstr_posts` VALUES("1094", "1", "2016-07-21 03:22:28", "2016-07-21 00:22:28", "[vc_row has_container=\"true\" container_class=\"container\" el_class=\"inner-top-xs inner-bottom-sm\"][vc_column width=\"8/12\"][vc_column_text]\r\n<h2>عن شركتنا</h2>\r\nإيجي ستار شركة متخصصة في توفير و دعم ماكينات التصوير المكتبية، و نتخصص في تقديم و عرض جميع موديلات ماكينات التصوير توشيبا E-Studio و يتوفر لدينا خدمات الإستبدال و الصيانة الدورية للماكينات القديمة لديك.\r\n\r\nايجي ستار تتميز بسرعة و سهولة التواصل، و تقديم خدمات صيانة ماكينات التصوير بشكل متخصص و سريع، و ذلك يضمن لك عدم القلق من مشاكل ماكينات التصوير الخاصة بمكتبك بعد الآن\r\n<h2></h2>\r\n[/vc_column_text][/vc_column][vc_column width=\"4/12\"][vc_column_text]\r\n<h2>متجر إلكتروني متكامل</h2>\r\nنعرض مجموعة متكاملة من موديلات توشيبا مرفق معها كامل التفاصيل و الخصائص للتمكن من اختيار المنتج المناسب لك. يمكنك تسجيل شراء أو استفسار و سنتواصل معك للرد علي استفسارك أو لتأكيد طلب و تحديد بيانات التوصيل.\r\n\r\nمتجرنا يوفر كامل تفاصيل الماكينات و يقدم دعم كامل للتعريفات و دليل المستخدم الخاص بكل منتج، نقدم للأعضاء إمكانية \"مقارنة المنتجات\" و \"قائمة رغبات العضو\" لتسهل عليك تحديد المنتج المناسب لنشاطك التجاري.[/vc_column_text][/vc_column][/vc_row][vc_row has_container=\"true\" container_class=\"container\" el_class=\"light-bg inner-sm\"][vc_column width=\"3/12\"][vc_column_text]\r\n<h2>ما يميز ايجي ستار</h2>\r\nايجي ستار شركة متخصصة في خدمات و دعم ماكينات التصوير توشيبا، و نعني بالدعم تقديم كافة خدمات ماكينات التصوير بشكل احترافي و متخصص.\r\n\r\nايجي ستار تشكل مجتمع خدمي متكامل لحل كل مشاكل ماكينات التصوير التي يواجهها عملائنا ابتداءاً من مرحلة الشراء وصولاً لما بعد البيع من صيانة و فحوصات دورية.[/vc_column_text][/vc_column][vc_column width=\"9/12\"][vc_row_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"سرعة التوصيل\" description=\"اطلب منتجك اونلاين و سيصلك بأقصي سرعة ممكنة أينما كنت.\" icon_class=\"fa-truck\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"دعم 24 ساعة/يوم\" description=\"نحن متواجدون دائماً للرد علي طلبك و لتوفير الدعم الفوري لأعطالك. نقدم خدمة الصيانة بأقصى سرعة ممكنة.\" icon_class=\"fa-life-saver\"][/vc_column_inner][vc_column_inner width=\"1/3\"][mc_service_icon title=\"الدعم و الصيانة\" description=\"نقدم دعم متكامل و صيانة سريعة و دورية لماكينات التصوير، يمكنك التواصل معنا لتحديد العطل الموجود بمنتجك و سنحدد لك ميعاد وصول فريق الصيانة لتصليح العطل.\" icon_class=\"fa-star\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]", "عن ماضي جروب", "", "inherit", "closed", "closed", "", "215-revision-v1", "", "", "2016-07-21 03:22:28", "2016-07-21 00:22:28", "", "215", "http://madyeg.com/215-revision-v1/", "0", "revision", "", "0");
